'From Squeak3.7-m17n of 29 June 2004 [latest update: #0] on 30 June 2004 at 12:02:52 am'!"Change Set:		BVSMInstallDate:		30 June 2004Author:		yoInstalls the text style 'BitstreamVeraSansMono'from a compressed MIME encoding in the postscript."!!TTCFont methodsFor: 'friend' stamp: 'yo 12/13/2002 12:13'!derivativeFonts	| result |	derivatives ifNil: [^ #()].	result _ OrderedCollection new.	derivatives do: [:f | result add: f].	^ result asArray.! !!TTCFont methodsFor: 'caching' stamp: 'nk 3/15/2004 18:52'!releaseCachedState	self flushCache.! !!TextStyle class methodsFor: 'mime file in/out' stamp: 'nk 1/19/2004 20:36'!collectionFromCompressedMIMEString: aString	"aString holds a compressed, Base64 representation of a SmartRefStream storage of a TextStyle.	Install the TextStyle."	| this newName style heights data |	data := (Base64MimeConverter mimeDecode: aString as: String) unzipped.	(RWBinaryOrTextStream with: data) reset; fileIn.	this := SmartRefStream scannedObject.	"now install it"	newName _ this fontArray first familyName.	this fontArray do: [:aFont | aFont familyName = newName ifFalse: [		self error: 'All must be same family']].	style _ TextConstants at: newName asSymbol ifAbsent: [		^ TextConstants at: newName asSymbol put: this].		"new family"	this fontArray do: [:aFont | "add new fonts"		heights _ style fontArray collect: [:bFont | bFont height].		(heights includes: aFont height) ifFalse: [			style fontAt: style fontArray size + 1 put: aFont]].! !!TextStyle class methodsFor: 'mime file in/out' stamp: 'nk 3/15/2004 19:37'!looseFontsFromFamily: familyName	"	TextStyle looseFontsFromFamily: 'Accuny'	TextStyle looseFontsFromFamily: 'Accujen'	TextStyle actualTextStyles keys collect: [ :k | TextStyle looseFontsFromFamily: k ]	"	| looseFonts realStyle classes |	realStyle _ TextStyle named: familyName.	classes _ ((realStyle fontArray copyWithout: nil) collect: [ :f | f class ]) asSet.	classes do: [ :cls | cls allSubInstancesDo: [ :f | f releaseCachedState ]].	Smalltalk garbageCollect.	looseFonts _ IdentitySet new.	classes do: [ :cls |		looseFonts addAll: ((cls allSubInstances select: [ :ea | ea familyName = familyName ])			reject: [ :f | realStyle fontArray anySatisfy: [ :fn | fn == f or: [ fn derivativeFonts includes: f ] ]]) ].	^looseFonts! !!TextStyle class methodsFor: 'mime file in/out' stamp: 'nk 3/15/2004 19:25'!replaceFontsIn: oldFontArray with: newStyle	"	TextStyle replaceFontsIn: (TextStyle looseFontsFromFamily: #Accuny) with: (TextStyle named: #Accuny)	"	"Try to find corresponding fonts in newStyle and substitute them for the fonts in oldFontArray"	newStyle fontArray do: [ :newFont | newFont releaseCachedState ].	oldFontArray do: [ :oldFont | | newFont |		oldFont reset.		newFont _ (newStyle fontOfPointSize: oldFont pointSize) emphasis: oldFont emphasis.		oldFont becomeForward: newFont ].	StringMorph allSubInstancesDo: [ :s | s layoutChanged ].	TextMorph allSubInstancesDo: [ :s | s layoutChanged ].	SystemWindow allInstancesDo: [ :w | [ w update: #relabel ] on: Error do: [ :ex | ] ].	World ifNotNilDo: [ :w | w changed ].! !!TextStyle class methodsFor: 'mime file in/out' stamp: 'nk 3/15/2004 19:05'!replaceStyle: oldStyle with: newStyle	"	TextStyle replaceStyle: (TextStyle named: #AccunyOLD) with: (TextStyle named: #Accuny)	"	"Try to find corresponding fonts in newStyle and substitute the fonts in oldStyle for them."	| oldKeys |	oldKeys _ Set new.	TextConstants keysAndValuesDo: [ :k :v | v = oldStyle ifTrue: [ oldKeys add: k ]].	oldKeys remove: #DefaultTextStyle ifAbsent: [].	oldKeys remove: #DefaultFixedTextStyle ifAbsent: [].	self replaceFontsIn: oldStyle fontArray with: newStyle.	oldStyle becomeForward: newStyle.	oldKeys do: [ :k | TextConstants removeKey: k ].! !"Postscript:Install the text style from the compressed MIME encoding, and replace the old one."TextConstants at: #BitstreamVeraSansMono ifPresent: [ :oldStyle |